using UnityEngine;

public class Setting : MonoBehaviour {
	GameMaster Game;
	Player player1;
	Player player2;
	void Awake(){
		//Game = GameObject.Find("GameMaster").GetComponent<GameMaster>();
	}

	void Start(){
		Game = new GameMaster();
		player1 = new Player();
		player2 = new Player();
	}

	// ボタンを押すとこの関数を実行する（対戦結果等はコンソールに表示される）
	public void PushTestButton(){
		// player1とplayer2にデータをセットする。SetData(セットするプレイヤ，ユニットの種類の配列，AIの配列);
		SetData(player1, GetUnits("第7回(fred)"), GetCodes("第7回(fred)"));
		SetData(player2, GetUnits("2ne"), GetCodes("2ne"));
		//Game関数は 4秒/200対戦 程度のスピード
		for(int i=0; i<100; i++){
			Debug.LogFormat("{0} の負け", Game.Play(player1, player2));
			Debug.LogFormat("{0} の負け", Game.Play(player2, player1));
		}
	}

	void SetData(Player _player, int[] _ids, string[] _json){
    for(int i=0; i<4; i++){
      NodeArrow.GetPlans(_player, i, _json[i]);
      _player.Units[i] = _ids[i];
    }
	}

	// ユニットの種類 キング:0，クイーン:18,9，ナイト:2,5,7，ビショップ:3,4,6，ポーン:10,11,12，ルーク:13,14,15
	int[] GetUnits(string _name){	
		switch(_name){
			case "第0回(son59)":
			return new int[4]{0,2,5,7};
			case "第1回(2ne)":
			return new int[4]{0,1,2,5};
			case "第2回(nota3)":
			return new int[4]{0,1,4,2};
			case "第3回(2ne)":
			return new int[4]{0,2,4,9};
			case "第4回(2ne)":
			return new int[4]{0,1,4,2};
			case "第5回(tokyo)":
			return new int[4]{0,11,5,7};
			case "第6回(tokyo)":
			return new int[4]{0,11,5,7};
			case "第7回(fred)":
			return new int[4]{0,8,14,3};
			case "第1回団体 先鋒\nfred":
			return new int[4]{0,8,13,3};
			case "第1回団体 次鋒\nfred":
			return new int[4]{0,2,13,14};
			default:
			return new int[4]{0,1,2,3};
			case "2ne":
			return new int[4]{0,7,13,14};
		}
	}



